import React from 'react'
import './ExploreIcon.css'
import { FiDownload } from 'react-icons/fi';


function ExploreIcon() {
    return (
        <div className='exploreIcon'>
            <FiDownload className='exploreIcon_icon' />
        </div>
    )
}

export default ExploreIcon
